import styled from "styled-components";
import { Button, Container } from "react-bootstrap";
import "./App.css";
import axios from "axios";
import { useEffect } from "react";

const Note = styled.div`
  text-decoration: none;
  margin: 20px 20px 20px 20px;
  align-items: center;
  color: #000;
  background: white;
  height: 30em;
  width: 50em;
  padding: 1em;
`;

const TaskName = styled.div`
  text-align: center;
  font-size: 30px;
`;

const Partner = styled.div`
  text-align: center;
  font-size: 20px;
`;

const api = axios.create({
  baseURL: "http://localhost:8081/api/tasks"
});

const fetchTickets = async () => {
  try {
    const { data } = await api.get("/tasks");
    return data;
    console.log(data);
  } catch (error) {
    console.warn("Failed to load tasks!");
  }
};

const Ticket = ({ data }) => {
  useEffect(() => {
    fetchTickets().catch(Error);
  }, []);
  console.log("Data " + data);
  return (
    <div className="note">
      <Note>
        <TaskName>Feladat neve</TaskName>
        <Partner>Partner</Partner>
        <Button variant="outline-secondary" className="about">
          Részletek megjelenítése
        </Button>
        <Button variant="outline-secondary" className="edit">
          Szerkesztés
        </Button>
      </Note>
      <Note>
        <div>Valami</div>
        <div>Valami</div>
        <Button variant="outline-secondary" className="about">
          Részletek megjelenítése
        </Button>
        <Button variant="outline-secondary" className="edit">
          Szerkesztés
        </Button>
      </Note>
    </div>
  );
};

export default Ticket;
